import React from "react";
import Photo from "./Photo";

const Carousel = (props) => {
  return (
    <Photo
      width={props.width}
      height={props.height}
      alt={props.alt}
      photographer={props.photographer}
      src={props.url}
      id={props.id}
    />
  );
};

export default Carousel;
